description:
It's beneficial to be an Alexela customer because now you can get all your energy from one place. All your energy solutions are just within reach. In the Alexela mobile app, you can:
 
-register as a customer and take advantage of numerous discounts and campaigns from the My Alexela loyalty programm;
-quickly navigate to the nearest gas station or cafe-store that suits you best;
-track your transaction history, invoices, and discounts;
-sign electricity and natural gas contracts and monitor your consumption;
-join our Community Program and reduce the environmental impact of your journeys.
